function SVG_reader(){


/*typical INPUT : */
/*
<g class="psd-layer group" opacity="0.25098039215686274" style="mix-blend-mode: normal;">
    <title>CADRES</title>
    <image class="psd-layer shape" height="1024" width="1810" x="1246" xlink:href="data:image/png;base64," y="834">
      <title>ep202_pl020</title>
    </image>
    <image class="psd-layer shape" height="2427" width="6076" x="-7" xlink:href="data:image/png;base64," y="-7">
      <title>bg_size</title>
    </image>
    <image class="psd-layer shape" height="752" width="1327" x="2502" xlink:href="data:image/png;base64," y="1140">
      <title>ep201_pl010</title>
    </image>
  </g>
	*/
	this.get_cadre = function(XMLobj,shot_code){
		
		var cadre = {};
		
		var groups = XMLobj['g'];
			
			for(var i in groups){
				
				cg = groups[i]; 
				
				MessageLog.trace("CG"); 
				MessageLog.trace(Object.getOwnPropertyNames(cg));
				
				var group_title = cg.title;
				MessageLog.trace(group_title);
				
				// possible problems if thee is just one group
				
				if(cg.title=="CADRES"){
					
					var gimages = cg['image']; 
					
					for(var i in gimages){
						
						var cimage = gimages[i]; 
						
						
						
						if(cimage.title == shot_code){
							
							var attr = cimage._Attribs;
							
							var rect = {
								width:attr.width,
								height:attr.height,
								x:attr.x,
								y:attr.y
							}
								
							MessageLog.trace(attr);	
								
							cadre.rect = rect;
							
						}
						
						if(cimage.title == "bg_size"){
							
							var attr = cimage._Attribs;
							
							var rect = {
								width:attr.width,
								height:attr.height,
								x:attr.x,
								y:attr.y
							}
								
							MessageLog.trace(attr);	
								
							cadre.bg = rect;
						}
							
					}				
					
				}

			}
			
			
			
		return cadre ;
		
	}
	
}